import React from 'react';
import { CssBaseline, Grid } from '@material-ui/core';
import {AppBar, Toolbar, Typography, InputBase, Box} from '@material-ui/core';
import {Avatar, Divider, Link, Button} from '@material-ui/core';
import SearchIcon from '@material-ui/icons/Search';
import useStyles from './style'

const App = () => {
  const classes = useStyles()
  return (
    <>
      <CssBaseline />
      {/*Header Section*/}
      <AppBar position='fixed'>
        <Toolbar className={classes.toolbar}>
          <Typography variant='h5' className={classes.title}>
            Traveler
          </Typography>
          <Box display='flex'>
            <Typography variant='h6' className={classes.title}>
              Discover the world
            </Typography>
            {/* <Autocomplete> */}
              <div className= {classes.search}>
                <div className= {classes.searchIcon}>
                  <SearchIcon />
                </div>
                <InputBase placeholder='Enter Distination' classes={{root: classes.InputRoot, input: classes.inputInput}}/>

              </div>
            {/* </Autocomplete> */}
          </Box>
        </Toolbar>
      </AppBar>
      {/*Profile Section*/}
      <div className={classes.container} style={{marginTop:70}}>
        <Grid container spacing={3}>
          <Grid item md={1}>
            <Avatar alt="Kritika Goel" src="https://thenewscrunch.com/wp-content/uploads/2020/08/Kritika-Goel.jpg" style={{width: 65, height: 65}}/>
          </Grid>
          <Grid item md={11}>
            <Typography>Created by<Link href='https://www.instagram.com/kritika_goel/?hl=en' variant="button"><br/>Kritika Goel</Link><br/></Typography>
            <Typography>from <Link href='https://www.britannica.com/place/India'>India</Link></Typography>
          </Grid>
        </Grid><br/>
        <Divider/>
      </div>
      {/*About Trip Section*/}
      <div className={classes.container} style={{paddingTop: 10}}>
        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Typography variant='h6'> From R 10000/pp</Typography>
            <Button variant="text">Enquire</Button>
          </Grid>
          <Grid item xs={12} md={6}>

          </Grid>
        </Grid><br/>
        <Divider />
      </div>
      {/*Info about Hotel Section*/}

      {/*Activities Section*/}

      {/*Map Info Section*/}
    </>
  );
}

export default App;
